import email_js from '@emailjs/browser';

export default function sendEmail(point_of_departure, destination, weight, name, phone, email) {

    const message = {
        "from_name": name,
        "email": email,
        "message":
            "Відпрвка: " + point_of_departure +
            "\nПрибуття: " + destination +
            "\nВага: " + weight +
            "\nТелефон: " + phone
    }

    email_js.send("service_fktr0no", "template_q36cnic", message,
        {publicKey: 't262JebAxXrwwSnI3',});
}
